import Character from './components/elements/body/main';
import Navbar from './components/elements/header/navbar';

function App() {
  return (

    <div className="App">
      <header className="App-header">
      <Navbar></Navbar>
      </header>
      <div>
      <Character></Character>
      </div>
    </div>

  );
}

export default App;
